    image:string;
    k:number;
    name:string;
    children: ReactNode;
}

export const Main5DefaultBody:React.FC<DefaultBlockSchema> = ({image,name,k,children}) => {
    const {t}=useTranslation()
    return(
        <>
            <div className={Main5Styles.container}>
                <img src={image}/>
                <div className={Main5Styles.body}>
                    {/* <h3>{t(`Main${k}.name`)}</h3> */}
                    <div className={Main5Styles.button}>
                        <Button variant="contained" style={{backgroundColor:"red"}}>{t("BookNow")}</Button>
                    </div>
                </div>
            </div>
        </>
    );
}
